import 'bootstrap/dist/css/bootstrap.min.css';
import React from "react";
import { Image, Navbar } from "react-bootstrap";
// import { NavLink } from "react-router-dom";
import '../App.css';
import HeartLogo from '../assets/HEART_FILLED.svg';
import ReactLogo from '../assets/React-icon.svg';
import BackArrow from '../assets/backArrow.svg';
import { TITLE } from "../constants/String";
import '../styles/Search.css';
import { useNavigate } from 'react-router-dom';




export const NavBar2 = () => {

    const navigate = useNavigate();


    const textInput = {
        color: '#fff',
        backgroundColor: '#232323',
        height: 50,
        width: '20%',
        borderRadius: 3,
        marginRight: 25
    };
    const reactLogoImg = {
        height: 50, width: 50
    }
    const mainView = {
        height: 100, backgroundColor: '#000', justifyContent: 'space-between'
    }
    const titleText = {
        color: '#fff'
    }
    const favImg = {
        height: 25, width: 25, marginRight: 20
    }

    return (
        <Navbar style={mainView}>
            <>
                <Image
                    onClick={() => navigate(-1)}
                    src={BackArrow}
                    style={{ height: 15, width: 15, marginLeft: 60, position: 'absolute', cursor: 'pointer' }}
                />
            </>



            <>
                <Image
                    src={ReactLogo}
                    style={reactLogoImg}
                />
                <Navbar.Brand href="/home" style={titleText}>{TITLE}</Navbar.Brand>
            </>
            <Navbar.Toggle />
            <Navbar.Collapse className="justify-content-end">
                <>
                    <label style={{ color: '#fff' }}>
                        Favourites
                    </label>
                </>
            </Navbar.Collapse>
        </Navbar>
    );
};
